import React from 'react';
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';
import bid from '../images/bidr.png'; // Import your logo image
import { BASE_URL } from '../../constants/constants';
import { useNavigate } from 'react-router-dom';
import './cards.css'; // Import your custom CSS file

export default function Cards({ court }) {
    const navigate = useNavigate();

    return (
        <Card className="rounded" style={{ width: '15rem', height: '16rem' }}>
            <Card.Img variant="top" src={`${BASE_URL}/courts/${court.courtPic}`} className="rounded-circle" />
            <Card.Body>
                <Card.Subtitle className="mt-2">{court?.courtName}</Card.Subtitle>
                <Button variant="dark" className="btn">
                    <img src={bid} alt="" className="icon" />
                </Button>
            </Card.Body>
        </Card>
    );
}

